import React from "react";
import "./style.css";

function Nav() {
  return (
    <nav className="navbar navbar-dark bg-dark">
      <div className="row col-12 d-flex justify-content-center text-white">
        <span className="h5">Register</span>
      </div>
    </nav>
  );
}

export default Nav;
